          <input type="text" placeholder="Username" required></input>
        </div>
        <div className="input-box">
          <input type="password" placeholder="Password" required></input>
        </div>

        <div className="remember-forgot">
          <label>
            <input type="checkbox" />
            Remember me
          </label>
        </div>
      </form>
    </div>
  );
}

export default App;
